  let [data1 , newData1] = useState();
  
  let dataChanged = (event) => {
    console.log(event.target.value);
    newName(data);
  }
  
  return (
    <>
      <div className = "container">
        <h1>Hello {Name}</h1>
        <input type = "text" onChange = {dataChanged} value = {data} />
        
      </div>
    </>
  )
}
